import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import PlaneModelList from "./components/PlaneModelList";


let planeModels = [
	{ designation: "Boieng 747" },
        { designation:"Airbus A380"},
        { designation:"Airbus A340"}
];


// fetch('http://localhost:8080/demo3-1.0/webresources/planeModel')
try {
fetch('http://localhost:8080/insset-airways-3.1/webresources/planeModel', {mode:'cors', credentials: 'same-origin'})
// fetch('webresources/planeModel')
  .then(function(response) {
    let json = response.json();
    console.log(json);
    return json;
  })
;
} catch (ex) {
    console.log(ex);
}



class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
	<PlaneModelList planeModels={planeModels}/>
      </div>
    );
  }
}

export default App;
